LongTestRange(long[] min, long[] max) {
  assert min != null && max != null && min.length > 0 && max.length > 0
      : "test box: min/max cannot be null or empty";
  assert min.length == max.length : "test box: min/max length do not agree";
  this.min = min;
  this.max = max;
}

